import React from 'react';
import PropTypes from 'prop-types';

const SectionStyle = (background) => ({
  height: '100vh',
  background,
})


const Section = (props) => {
  return(
    //<AboutUs />
    <section className="container-fluid m-1" style={SectionStyle(props.bgStyle)} >
      <div className="row">
        <props.component />
      </div>
    </section>
  );
}

Section.propTypes = {
  component: PropTypes.node.isRequired
}


export default Section;
